import React, { useEffect } from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/home';
import Login from './pages/login';
import Signup from './pages/signup';
import Footer from './components/Footer';
import Attribution from './pages/Attribution';
import Employees from './pages/Employees';
import Equipment from './pages/Equipment';
import AddEmployee from './pages/AddEmployees';
import AddEquipment from './pages/AddEquipment';
import AssignEquipment from './pages/Attribution';
import AddEditEmployee from './pages/AddEditEmployee';
import EmployeeAssignments from './pages/EmployeeAssignments';
import EditAttribution from './pages/EditAtribution';
import EditEmployee from './pages/EditEmployee';
import EditEquipment from './pages/EditEquipment';

const App = () => {
  // Initialize localStorage data
  useEffect(() => {
    if (!localStorage.getItem('employes')) {
      localStorage.setItem('employes', JSON.stringify([
        {
          id_employee: 1,
          nom: "Doe",
          prenom: "John",
          email: "john@example.com",
          poste: "Manager"
        }
      ]));
    }

    if (!localStorage.getItem('materiel')) {
      localStorage.setItem('materiel', JSON.stringify([
        {
          id_materiel: "EQ-1001",
          type_materiel: "Laptop",
          marque: "Dell",
          modele: "XPS 15",
          etat: "Disponible"
        }
      ]));
    }

    if (!localStorage.getItem('attributions')) {
      localStorage.setItem('attributions', JSON.stringify([]));
    }
  }, []);
<script src="http://localhost:8097"></script>
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/Employees" element={<Employees />} />
        <Route path="/Equipment" element={<Equipment />} />
        <Route path="/Attribution" element={<Attribution />} />
        <Route path="/AddEmployee" element={<AddEmployee />} />
        <Route path="/AddEquipment" element={<AddEquipment />} />
        <Route path="/AssignEquipment" element={<AssignEquipment />} />
        <Route path="/EditEmployee/:id" element={<AddEditEmployee />} />
        <Route path="/EmployeeAssignments/:id" element={<EmployeeAssignments />} />
        <Route path="/EditAttribution/:id" element={<EditAttribution />} />
        <Route path="/EditEmployee/:id" element={<EditEmployee />} />
        <Route path="/Equipment" element={<Equipment />} />
        <Route path="/EditEquipment/:id" element={<EditEquipment />} />        
      </Routes>
      <Footer />
    </Router>

  );
};

export default App;
